import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import './CVCheckIn.module.scss';

const CVCheckIn = () => {
  const navigate = useNavigate();
  const [scanPhase, setScanPhase] = useState('initial'); // initial, scanning, complete
  const [progress, setProgress] = useState(0);
  const [recognizedUser, setRecognizedUser] = useState(null);
  const videoRef = useRef(null);
  const canvasRef = useRef(null);

  // Handle the start of face recognition process
  const startFaceRecognition = () => {
    setScanPhase('scanning');

    // Simulate a face recognition process with progress
    const timer = setInterval(() => {
      setProgress(prev => {
        if (prev >= 100) {
          clearInterval(timer);
          setScanPhase('complete');
          // Simulate recognition result
          setRecognizedUser('John Doe');
          return 100;
        }
        return prev + 4; // Increment by 4% each time
      });
    }, 150);
  };

  // Handle user confirming identity
  const confirmIdentity = () => {
    navigate('/patientverification');
  };

  // Handle user rejecting identity
  const rejectIdentity = () => {
    setScanPhase('initial');
    setProgress(0);
    setRecognizedUser(null);
  };

  // Handle try again
  const tryAgain = () => {
    setScanPhase('initial');
    setProgress(0);
  };

  // Simulate camera display (in a real app, this would use a real camera feed)
  useEffect(() => {
    if (scanPhase === 'scanning' && videoRef.current && canvasRef.current) {
      const canvas = canvasRef.current;
      const ctx = canvas.getContext('2d');

      // Draw a placeholder for camera feed
      ctx.fillStyle = '#2c3e50';
      ctx.fillRect(0, 0, canvas.width, canvas.height);

      // Draw a face detection box
      ctx.strokeStyle = '#3c7b9e';
      ctx.lineWidth = 3;
      ctx.strokeRect(canvas.width * 0.2, canvas.height * 0.2, canvas.width * 0.6, canvas.height * 0.6);
    }
  }, [scanPhase]);

  return (
    <div className="cv-checkin-page">
      <div className="header">
        <div className="logo-small">
          <img src="/assets/logo.png" alt="OptiCheck" />
        </div>
        <div className="title-text">
          {scanPhase === 'initial' ? 'Check-In' : 
           scanPhase === 'scanning' ? 'Check-In Scan' : 
           'Identity Verification'}
        </div>
        <div className="info-icon">i</div>
      </div>

      <div className="progress-container">
        <div className="progress-bar">
          <div 
            className="progress-fill"
            style={{ width: `${progress}%` }}
          ></div>
        </div>
      </div>

      <div className="content-area">
        {scanPhase === 'initial' && (
          <div className="start-container">
            <button 
              className="start-button"
              onClick={startFaceRecognition}
            >
              Check-In
            </button>
          </div>
        )}

        {scanPhase === 'scanning' && (
          <div className="camera-container">
            <div className="camera-view">
              <video 
                ref={videoRef} 
                className="video-feed"
                style={{ display: 'none' }}
              ></video>
              <canvas 
                ref={canvasRef} 
                width={400} 
                height={400} 
                className="canvas-overlay"
              ></canvas>
            </div>

            <div className="instructions">
              Please stay still while we scan your face
            </div>
          </div>
        )}

        {scanPhase === 'complete' && recognizedUser && (
          <div className="verification-container">
            <div className="result-message">
              <h2>We detected you as:</h2>
              <div className="user-name">{recognizedUser}</div>
              <p>Is this correct?</p>
            </div>

            <div className="action-buttons">
              <button 
                className="confirm-button"
                onClick={confirmIdentity}
              >
                Yes, that's me
              </button>

              <button 
                className="reject-button"
                onClick={rejectIdentity}
              >
                No, that's not me
              </button>
            </div>
          </div>
        )}

        {scanPhase === 'complete' && !recognizedUser && (
          <div className="verification-container">
            <div className="result-message error">
              <h2>No identity match found</h2>
              <p>Please try again with better lighting and positioning.</p>
            </div>

            <button 
              className="retry-button"
              onClick={tryAgain}
            >
              Try Again
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default CVCheckIn;
